import React, { useContext, useEffect, useState } from "react";
import { AuthContext } from "../contexts/AuthContext";

const Dashboard = () => {
  const { token, setToken } = useContext(AuthContext);
  const [contacts, setContacts] = useState([]);
  const [form, setForm] = useState({ name: "", email: "", contact: "" });
  const [msg, setMsg] = useState("");
  const [editingId, setEditingId] = useState(null);

  // Fetch contacts logic
  const getContacts = async () => {
    setMsg("");
    try {
      const res = await fetch("/api/contacts", {
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!res.ok) throw new Error("Failed to fetch contacts");
      setContacts(await res.json());
    } catch (err) {
      setMsg(err.message);
    }
  };

  useEffect(() => {
    getContacts();
    // eslint-disable-next-line
  }, [token]);

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async e => {
    e.preventDefault();
    setMsg("");
    
    try {
      const res = await fetch("/api/contacts", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(form),
      });
      if (!res.ok) throw new Error("Failed to add contact");
      setForm({ name: "", email: "", contact: "" });
      setMsg("Contact added!");
      getContacts();
    } catch (err) {
      setMsg(err.message);
    }
  };

  const handleDelete = async id => {
    setMsg("");
    try {
      const res = await fetch(`/api/contacts/${id}`, {
        method: "DELETE",
        headers: { Authorization: `Bearer ${token}` },
      });
      if (!res.ok) throw new Error("Failed to delete contact");
      setMsg("Contact deleted!");
      getContacts();
    } catch (err) {
      setMsg(err.message);
    }
  };

  const handleEdit = contact => {
    setEditingId(contact._id);
    setForm({ name: contact.name, email: contact.email, contact: contact.contact });
  };

  const handleUpdate = async e => {
    e.preventDefault();
    setMsg("");
    try {
      const res = await fetch(`/api/contacts/${editingId}`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(form),
      });
      if (!res.ok) throw new Error("Failed to update contact");
      setEditingId(null);
      setForm({ name: "", email: "", contact: "" });
      setMsg("Contact updated!");
      getContacts();
    } catch (err) {
      setMsg(err.message);
    }
  };

  const handleLogout = () => {
    setToken(null);
  };

  return (
    <div>
      <h2>Dashboard</h2>
      <button onClick={handleLogout}>Logout</button>
      <h3>{editingId ? "Edit Contact" : "Add Contact"}</h3>
      <form onSubmit={editingId ? handleUpdate : handleSubmit}>
        <input name="name" placeholder="Name" value={form.name} onChange={handleChange} required />
        <input name="email" placeholder="Email" value={form.email} onChange={handleChange} required />
        <input name="contact" placeholder="Contact" value={form.contact} onChange={handleChange} required />
        <button type="submit">{editingId ? "Update" : "Add"}</button>
        {editingId && <button type="button" onClick={() => { setEditingId(null); setForm({ name: "", email: "", contact: "" }); }}>Cancel</button>}
      </form>
      {msg && <div>{msg}</div>}
      <h3>Contacts</h3>
      <ul>
        {contacts.map(c => (
          <li key={c._id}>
            {c.name} - {c.email} - {c.contact}
            <button onClick={() => handleEdit(c)}>Edit</button>
            <button onClick={() => handleDelete(c._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Dashboard;
